import React, { Component, Fragment } from 'react';
import Nav from './Nav';
import Header from './Header';
import Service from './Services';
import About from './About';
import Contact from './Contact';
import Footer from './Footer';

class Home extends Component {

    constructor(props){
        super(props);

        this.state = {
            search_input: '',
            list: {p1:'one',p2:'tow'}
        }
    }

    render() {
        return (
            <Fragment>
                <Nav/>
                <Header/>
                <Service/>
                <About/>
                <Contact/>
                <Footer/>
            </Fragment>
        )
    }

}

export default Home;
